import Signup from "./pages/signup";
import Login from "./pages/login";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import "./App.css";

const router = createBrowserRouter([
  {
    path: "/",
    element: <div>Hello world!</div>,
  },
]);

function App() {
  return (
    <div className="App">
      <Signup />
      <Login />
    </div>
  );
}

export default App;
